import React from "react";
import { Element } from "react-scroll";
import TopContent from "../TopContent/TopContent";
import "./TopContainer.css";
import "font-awesome/css/font-awesome.min.css";

const TopContainer = () => {
  return (
    <Element name="Home" className="topcontainer">
        <div className="">
      <TopContent />
      <h4>powered by Annamalai University</h4>
      <hr />
      <div>
       <a href="https://github.com/Tech-Club-CSE-FEAT-AU"><i className="fa fa-github fa-2x"></i></a>
        <a href="#"><i className="fa fa-telegram fa-2x"></i></a>
      </div>
      </div>
    </Element>
  );
};

export default TopContainer;
